,p_plsql_code=>wwv_flow_utilities.join(wwv_flow_t_varchar2(
'/*',
' * render - function to create placeholder div tag, and initialise the  component',
' */',
' function render_chart ',
'( p_region                in  apex_plugin.t_region',
', p_plugin                in  apex_plugin.t_plugin',
', p_is_printer_friendly   in  boolean ',
') return apex_plugin.t_region_render_result ',
'is',
'  c_region_static_id      constant varchar2(255)  := apex_escape.html_attribute( p_region.static_id );',
'  l_result apex_plugin.t_region_render_result;',
'  l_title VARCHAR2(32767) := p_region.attribute_01;',
'  l_bgcolor VARCHAR2(32767) := p_region.attribute_02;',
'  l_bdcolor VARCHAR2(32767) := p_region.attribute_03;',
'  l_bigtitle VARCHAR2(32767) := p_region.attribute_04;',
'begin',
'  -- Add canvas',
'  sys.htp.p ( ''<canvas id=''||''"''||c_region_static_id||''_static''||''"'' ||''style="display: block; width: 100%; height: 100%;" width="1068" height="534" class="chartjs-render-monitor"></canvas>''  );',
'',
'-- add all javascript files',
'    apex_javascript.add_library (',
'        p_name      => ''Chart.min'',',
'        p_directory => p_plugin.file_prefix,',
'        p_version   => null ); ',
'  apex_javascript.add_library (',
'      p_name      => ''chartplugin'',',
'      p_directory => p_plugin.file_prefix,',
'      p_version   => NULL',
'    );',
'     ',
'  -- Initialize the chart',
'  apex_javascript.add_onload_code (',
'   ''initChart({''',
'      ||''"ajaxIdent" : "''|| APEX_PLUGIN.GET_AJAX_IDENTIFIER ||''"''||   '', "chartTitle" : "''    || l_title ||''"''',
'      ||   '', "bgColor" : "''    || l_bgcolor ||''"''',
'      ||   '', "bdColor" : "''    || l_bdcolor ||''"''',
'      ||   '', "bigtTitle" : "''    || l_bigtitle ||''"''',
'      ||   '', "region_static_id" : "''    || c_region_static_id ||''_static''||''"''',
'      || ''});''',
'  );',
'  ',
'  ',
'  return l_result;',
'end render_chart;',
'',
'/*',
' * ajax - function to process SQL query, and output JSON data for the chart',
' */',
'function ajaxchart',
'( p_region    in  apex_plugin.t_region',
', p_plugin    in  apex_plugin.t_plugin ',
') return apex_plugin.t_region_ajax_result',
'is',
'  c       sys_refcursor;',
'  l_query varchar2(32767);',
'  l_return            apex_plugin.t_region_ajax_result;',
'begin  ',
'  l_query := p_region.source;',
'  open c for l_query;',
'  apex_json.write(c);',
'  ',
'  return l_return;',
'end ajaxchart;',
''))
,p_render_function=>'render_chart'
,p_ajax_function=>'ajaxchart'
